import './App.css';
import React, { useState } from 'react';


function App() {
    const [obj, setObj] = useState({
		prop1: 'value1',
		prop2: 'value2',
		prop3: 'value3',
	});

    const copy  = Object.assign({}, obj);
    copy.prop1 = '!';

    return <div>
    <span>{obj.prop1}</span>,
    <span>{obj.prop2}</span>,
    <span>{obj.prop3}</span>
</div>;

}
export default App;
